            "strokeAlign": "OUTSIDE",
            "effects": [],
            "characters": "The Views page is where you would collect the complete view of whatever you are building: this could be pages (like a web site) or complete/partial views in an application.\n\nNotice how this example uses the component from the Components page, which in turn is nothing than a collation of componentized elements. Normally, a page or view will be a number of components.\n\nSince this is a basic example, only the mobile version has been modified. By cleverly using auto-layout and constraints you may be able to skip the type of hackjob I am showing in the mobile view! :)\n\nNote: The Views page is not generated into code. It should be a very small thing for a develop to assemble a page or view if theyve built the elements, then the components, before-hand.",
